css:
.symbols-tree-view {
  width: 200px;
  height: 100%;
  padding: 4px;
  position: relative;
  overflow-y: auto;
  overflow-x: hidden;
}
.symbols-icon-base {
  width: 13px;
  height: 12px;
  display: inline-block;
  content: '';
  background-position: center center;
  background-size: 100%;
  background-repeat: no-repeat;
}
.symbols-tree-view .icon-function::before {
  width: 13px;
  height: 12px;
  display: inline-block;
  content: '';
  background-position: center center;
  background-size: 100%;
  background-repeat: no-repeat;
  background-image: url(atom://symbols-tree-view/icons/icon-function.svg);
}
